/** @format */

import React from 'react';

function AdminDashboard(props) {
	return (
		<div className="container">
			<div className="row">
				<div className="col-md-3"><p className=''></p>Number of Registered User</div>
				<div className="col-md-3">Number of Registered Farms</div>
				<div className="col-md-3">Number of Products</div>
				<div className="col-md-3">Number of Used Products</div>
			</div>
		</div>
	);
}

export default AdminDashboard;
